import React from 'react'
import Box from "@mui/material/Box";
import Modal from "@mui/material/Modal";
import {
    CardHeader,
    CardMedia,
    Typography,
    Button,
  } from "@mui/material";

const AuthModal = () => {
  return (
    <>
     <Modal
    open={true}
    aria-labelledby="modal-modal-title"
    aria-describedby="modal-modal-description"
  >
    <Box sx={style}>
      <Typography
        id="modal-modal-title"
        variant="h6"
        component="h2"
        textAlign={"center"}
      >
        No Data Found
      </Typography>
      <Button
        color="error"
        sx={{ marginLeft: 20 }}
        onClick={() => navigate(-1)}
      >
        Go Back
      </Button>
    </Box>
  </Modal> 
    </>
  )
}

export default AuthModal
